<!DOCTYPE html>
<html>

<head>
	<meta charset="utf-8" />
	<title>My</title>
	<meta name="viewport" content="width=device-width,initial-scale=1.0,maximum-scale=1.0,user-scalable=no" />
	<meta name="misapplication-tap-highlight" content="no" />
<link href="dist/js/chunk-common.js" rel="preload" as="script"><link href="dist/js/chunk-vendors.js" rel="preload" as="script"><link href="dist/js/my.js" rel="preload" as="script"></head>

<body> 
	
	<div id="app"></div>
	
	<!-- built files will be auto injected -->
	<script src="static/js/mui.min.js"></script>
	<script>
		function pageEvent(pageName, name, data){
			var payload = {
				pageName: pageName,
				name: name,
				data: data
			};
			var event = new CustomEvent('pageEvent', { 'detail': payload });
			window.dispatchEvent(event);
		}
	</script>
<script type="text/javascript" src="dist/js/chunk-vendors.js"></script><script type="text/javascript" src="dist/js/chunk-common.js"></script><script type="text/javascript" src="dist/js/my.js"></script></body>

</html>
